def kmer_dict(string,mer_len):
    # returns a dictionary of kmers based on a given kmer length
    if mer_len>len(string):
        raise Exception("Kmer length is greater than sequence")
    mer=""
    mer_dict={}
    for i in string:
        while len(mer)<mer_len:
            mer+=i
        if mer not in mer_dict.keys():
            mer_dict[mer]=1
        else:
            mer_dict[mer]+=1
        mer=mer[1:]
    return mer_dict

def most_frequent_kmers(string,mer_len):
    # returns the most frequent kmers within a given length
    mer_dict=kmer_dict(string,mer_len)
    max_freq=max(mer_dict.values())
    top_kmers=[]
    for key,value in mer_dict.items():
        if value==max_freq:
            top_kmers.append(key)
    return top_kmers


def motif_cnt(string,substring):
    """count the number of times a substring occurs in a string"""
    if len(string)<len(substring):
        raise Exception("Motif length is greater than sequence")
    mer=""
    cnt=0
    for i in string:
        while len(mer) <len(substring):
            mer+=i
        if mer==substring:
            cnt+=1
        mer= mer[1:]
    return cnt
        

def reverse_complment(string):
    """
    returns the reverse complements DNA sequence
    """
    rev_complement=""
    for i in string.upper():
        if i =="A":
            rev_complement+="T"
        if i =="T":
            rev_complement+="A"
        if i =="G":
            rev_complement+="C"
        if i =="C":
            rev_complement+="G"
    return rev_complement[::-1]
    
def motif_positions(string,substring):
    """
    returns the starting positions of a motif in a string as a list
    """
    mot=""
    motif_pos=[]
    for idx, nt in enumerate(string):

        while len(mot)<len(substring):
            mot+=nt
        if mot ==substring:
            motif_pos.append(idx-3)
        mot=mot[1:]
    return motif_pos

